import React from 'react';
import './../../App.scss'
import './Post.scss'

const Post = () => {

    let register = useForm()
    return (
        <section className='post__section'>
                <h1 className='post__title title'>Working with POST request</h1>
                <form className='post__form'>
                    <div className='error'>Error</div>
                    <input className='input__validation' type='name' placeholder='Your name'/>
                    <div className='error'>Error</div>
                    <input className='input__validation' type='email' placeholder='Email'/>
                    <div className='error'>Error</div>
                    <input className='input__validation' type='phone' placeholder='Phone'/>
                    <p className='num__example'>+38 (XXX) XXX - XX - XX</p>
                    <div className='radio__buttons'>
                        <input type="radio" value="A"/>
                        <input type="radio" value="B"/>
                        <input type="radio" value="C"/>
                    </div>
                </form>
        </section>
    );
};

export default Post;
